      numExecutors: 0
      disableRememberMe: false
      markupFormatter:
        rawHtml:
          disableSyntaxHighlighting: false
      primaryView:
        all:
          name: "all"
      projectNamingStrategy: "standard"
      quietPeriod: 5
      remotingSecurity:
        enabled: true
      scmCheckoutRetryCount: 0
    unclassified:
      gitSCM:
        createAccountBasedOnEmail: false
        globalConfigEmail: "sd-app-sre@redhat.com"
        globalConfigName: "App-SRE Team"
        showEntireCommitSummaryInChanges: false
        useExistingAccountWithSameEmail: false
      globalVaultConfiguration:
        configuration:
          vaultCredentialId: "vault-creds"
          vaultUrl: "https://vault.devshift.net"
      location:
        adminAddress: "sd-app-sre@redhat.com"
      pollSCM:
        pollingThreadCount: 10
      slackNotifier:
        botUser: false
        room: "#sd-app-sre-info"
        sendAsText: false
        teamDomain: "coreos"
        tokenCredentialId: "slack-integration-token"
